data: {"id":"msg_u2eL3ur24lup6oSssJ5GlHz8","object":"thread.message","created_at":1755737075,"assistant_id":"asst_2lbBjIQs31ASK30c0FsmknBp","thread_id":"thread_p4RBCQN93zOQjdRX1sNEwJ2w","run_id":"run_pAl8qOjPHoSLnxAGmhSgw4qE","status":"completed","incomplete_details":null,"incomplete_at":null,"completed_at":1755737086,"role":"assistant","content":[{"type":"text","text":{"value":"The document outlines comprehensive processes and guidelines for managing promo code requests, product launches, and promotion campaigns within Microsoft. Here's a summary of the key sections:\n\n### **DARSy Promo Code Request System**\n- **Purpose**: Manages promo codes for Microsoft products such as Dynamics 365, Power Platform, EMS, Office, and Windows.\n- **Steps for Requestors**: Guidance on submitting a request, selecting promo purposes, products, and completing forms.\n- **Approval Process**: SLA for approvals is 10 days, involving triage and approval teams.\n- **Common Use Cases**: Covers internal testing, demo uses, external evaluation trials, etc.\n- **Known Issues**: Highlights troubleshooting suggestions for promo codes that fail to redeem or encounter errors.\n\n### **Subscription & Product Launch Processes**\n- **Launch Scenarios**: Includes guidelines for various scenarios such as price changes, new SKUs, geographical expansions, new service plans, and more.\n- **Deadlines**: Details strict timelines for ensuring inclusion in locked scope and execution.\n- **Compliance**: Emphasizes the need for lifecycle management, accurate configuration, and compliance before General Availability (GA).\n- **Tools**: Usage of Partner Center and Legacy tools for CR creation, intake forms, and validation checks.\n\n### **Promotions Management**\n- **Promotion Types**: Differentiates between standard promotions, volume promotions, specialized offers, and promo codes.\n- **Processes**: Includes creating MLC (Microsoft Launch Center) requests, necessary approvals (e.g., Product Finance and CELA), RevRec forms, and council review.\n- **Timelines**: Standard subscription promotions take about 4 weeks; complex requests (e.g., for new SKUs or sales motion enablement) require longer periods.\n\n### **Onboarding and Stakeholders**\n- **Tools and Systems**: Training on the Microsoft Launch Center, LRD Tool, First Party (Cayman), and Consumption Launch processes.\n- **Roles & Responsibilities**: Business Planners, Vendor Operations, Launch Leaders, and CMX teams each play distinct parts in managing launches.\n- **Training Resources**: Access to Commercial Launch Hub and guides tailored for new planners.\n\n### **Automation and Metrics**\n- **Changes in Process**: Highlights automation improvements via tools like APT (Automated Pricing Tool) and Partner Center validations.\n- **Meter Minting**: Provides FAQs and troubleshooting for onboarding SKUs or offers.\n\nThis guide centralizes key processes for managing launches, promo codes, and promotions while ensuring adherence to compliance, operational efficiency, and transparency【3:1†source】【3:8†source】.","annotations":[{"type":"url_citation","text":"【3:1†source】","start_index":2631,"end_index":2643,"url_citation":{"url":"https://microsoft.sharepoint.com/teams/CloudBusinessOperationsResourceHub/SitePages/Promo-Code-Request-Guide-and-FAQ.aspx","title":"https://microsoft.sharepoint.com/teams/CloudBusinessOperationsResourceHub/SitePages/Promo-Code-Request-Guide-and-FAQ.aspx"}},{"type":"url_citation","text":"【3:8†source】","start_index":2643,"end_index":2655,"url_citation":{"url":"https://microsoft.sharepoint.com/teams/CloudBusinessOperationsResourceHub/SitePages/New-Promotions-Process.aspx","title":"https://microsoft.sharepoint.com/teams/CloudBusinessOperationsResourceHub/SitePages/New-Promotions-Process.aspx"}}]}}],"attachments":[],"metadata":{}}

